import React from "react";

const ProdutosList = ({ produtos }) => {
    return (
        <>
             {produtos.map((produto, i) => (
                    <div className="card" key={i}>
                        <div key={i}>
                            <img
                                src="https://source.unsplash.com/600x800"
                                alt=""
                            />
                            <li key={i}>
                                {produto.name}
                                <a key={i} href="#id">
                                    R${produto.price}
                                </a>
                            </li>
                        </div>
                    </div>
                ))}
        </>
    );
};

export default ProdutosList;
